// src/components/MonthTile.js
import React from 'react';
import {
  SummerAnimation,
  WinterAnimation,
  MonsoonAnimation,
  SpringAnimation,
  AutumnAnimation
} from './Animations';

const MonthTile = ({ month, index }) => {
  const renderAnimation = () => {
    switch (month) {
      case 'June':
      case 'July':
      case 'August':
        return <SummerAnimation />;
      case 'December':
      case 'January':
      case 'February':
        return <WinterAnimation />;
      case 'March':
      case 'April':
      case 'May':
        return <SpringAnimation />;
      case 'September':
      case 'October':
      case 'November':
        return <AutumnAnimation />;
      default:
        return null;
    }
  };

  return (
    <div className="month-tile">
      <div className="month-name">{month}</div>
      {renderAnimation()}
    </div>
  );
};

export default MonthTile;
